pragma solidity ^0.8.7;

import "./Token.sol";

contract Voting {

    struct Voter {
        address addr; // адрес избирателя
        bool voted; // флаг голосования: true - проголосовал, false - не проголосовал
        uint vote; // голос избирателя - токен, кототорый отправляет председатель??? после авторизации избирателя
    }

    struct Proposal {
        address addr; // адрес 
        string name; // название (имя кандидата)
    }

    string name; 

    uint start; // время начало голосования

    uint end; // время конца голосования

    address chairperson; // адрес кошелька председателя голосования

    Voter[] voters; // список избирателей

    Proposal[] proposals; // список предложений/кандидатов

    Token token = new Token(); // токен для голосования

    constructor(string memory _name, uint _start, uint _end) public {
        
        name = _name;
        start = _start;
        end = _end;
    }

    function addVoters(Voter[] memory _voters) public {
        for (uint i = 0; i < _voters.length; i++) {
            voters.push(_voters[i]);
        }
    }

    function addProposal(Proposal[] memory _proposals)public {
        for (uint i = 0; i < _proposals.length; i++) {
            proposals.push(_proposals[i]);
        }
    }

    function containsVoterAddr(address addr) public returns (bool) {
        bool flag = false;
        for (uint i = 0; i < voters.length; i++) {
            if (addr == voters[i].addr) {
                flag = true;
            }
        }
        return flag;
    }

    function authorize(address voterAddr) public {
        // проверка на наличие избирателя в списке избирателей по адресу, 
        // а затем начислить токен giveTokenToVoter
        require(containsVoterAddr(voterAddr), "Voter doesn't exist.");
        giveTokenToVoter(voterAddr);
    }

    function giveTokenToVoter(address voterAddr) public {
        // начисление токена на кошелек избирателя
        token.mint(voterAddr, 1);
    }

    function vote(Voter memory voter, Proposal memory proposal) public {
        // голосование: перевод токена от избирателя на адрес кошелька преложения
        require(voter.voted, "Already voted."); // проверка на проголосовавшего
        token.transferFrom(voter.addr, proposal.addr, 1);
        voter.voted = true;
    }

    /*
    function getResult() external view returns (mapping(address => uint256) memory) {
        // возвращает список результатов
        mapping (address => uint256) memory results;
        for (uint i = 0; i < proposals.length; i++) {
            results[proposals[i].addr] = token.balanceOf(proposals[i]);
        }
        return results;
    }

    function getWinner() public {

    }
    */

}

